import React from "react";
import { useState, useEffect } from "react";
import NavPages from "../../../components/NavPages";
import api from "./../../../api";

const initialState = {
	count: 0,
	currentPage: 0,
	totalPages: 0,
	totalCount: 0,
	items: [],
};

export default function DashBoardPage() {
	const [userListState, setUserListState] = useState(initialState);

	const handleChangePage = (count) => {
		console.log("currentPage", count);
		api
			.get(
				`/QuanLyNguoiDung/LayDanhSachNguoiDungPhanTrang?MaNhom=GP01&soTrang=${count}&soPhanTuTrenTrang=10`
			)
			.then((result) => {
				console.log(result.data);
				setUserListState(result.data);
			})
			.catch((err) => console.log(err));
	};

	const renderUserList = () => {
		const { items } = userListState;
		if (items && items.length > 0) {
			return items.map((user, index) => {
				return (
					<tr key={index}>
						<td>{user.taiKhoan}</td>
						<td>{user.matKhau}</td>
						<td>{user.hoTen}</td>
						<td>{user.email}</td>
						<td>{user.soDt}</td>
						<td>{user.maLoaiNguoiDung}</td>
						<td>
							<button className="btn btn-info">Edit</button>
						</td>
						<td>
							<button className="btn btn-danger">delete</button>
						</td>
					</tr>
				);
			});
		}
	};

	useEffect(() => {
		api
			.get(
				"/QuanLyNguoiDung/LayDanhSachNguoiDungPhanTrang?MaNhom=GP01&soTrang=1&soPhanTuTrenTrang=10"
			)
			.then((result) => {
				console.log(result.data);
				setUserListState(result.data);
			})
			.catch((err) => console.log(err));
	}, []);
	return (
		<div className="container userList">
			<h1>User List</h1>
			<div className="row">
				<div className="col-sm-12">
					<table className="table">
						<thead>
							<tr>
								<th>Tài Khoản</th>
								<th>Mật Khẩu</th>
								<th>Họ Tên</th>
								<th>Email</th>
								<th>Số Điện Thoại</th>
								<th>Loại Người Dùng</th>
							</tr>
						</thead>
						<tbody>{renderUserList()}</tbody>
					</table>
				</div>
			</div>
			<div className="row">
				<div className="col-sm-12">
					<NavPages
						currentPage={userListState.currentPage}
						totalPages={userListState.totalPages}
						handleChangePage={handleChangePage}
					/>
				</div>
			</div>
		</div>
	);
}
